import ColorLogo from "./buildnet-logo.png";
import ColorLogoB from "./buildnet-logo.png";
import EmailSent from "./emailSent.png";
import Food from "./food.png";
import FoodWhite from "./food_white.png";
import SplashScreen from "./splashscreen.png";
import AvatarUser from "./avatar.jpg";
import Photo2 from "./photo2.jpg";
import Photo1 from "./photo1.jpg";
import Arch from "./arch.jpeg";
import Arch1 from "./arch1.jpeg";
import Arch2 from "./arch2.jpeg";
import Arch3 from "./arch3.jpeg";

let png = {};

png = {
  ColorLogo,
  ColorLogoB,
  EmailSent,
  FoodWhite,
  AvatarUser,
  Food,
  SplashScreen,
  Photo2,
  Photo1,
  Arch,
  Arch1,
  Arch2,
  Arch3,
};

export default png;
